import React from 'react'
import Carousel from 'react-bootstrap/Carousel'
import CarouselItem from 'react-bootstrap/esm/CarouselItem'
import 'boot'

const Slider = ({start}) => {
  return (
    <Carousel>
    
    {
    
    start.map((item)=>(

           <Carousel.Item>
            <img
            className="d-block w-100"
            src={item}
            alt="First slide"
            />
           </Carousel.Item>

    ))

    
    
    
    }
  
    </Carousel>
  )
}

export default Slider
